import React, { Component } from 'react';
import {
    Row,
    Col
} from "reactstrap";
import axios from "axios";
import './Settings.css'


class Settings extends Component {

    state = {
        sensor: []
    }

    componentDidMount = () => {
        this.getSensors()
    }

    getSensors = () => {
        axios.get('http://0.0.0.0:5000/sensors')
            .then(
                res => {
                    console.log(JSON.parse(res.data.sensors))
                }
            )
    }

    render = () => {
        return (
            <div>
                <Row className="sensors">

                    <div className="sensors__item"></div>
                    <div className="sensors__item sensors_add"></div>
                </Row>
            </div>
        )
    }
}

export default Settings
